import React, { useState, useEffect } from 'react';


const Testfetch = () => {
  const [userInfo, setUserInfo] = useState(null);
  const movieIdToFind = 2; // Replace with the desired userid

  const fetchUserInfo = async () => {
    try {
      const response = await fetch(`http://localhost:3002/db/users/${movieIdToFind}`);
      const data = await response.json();
      setUserInfo(data);
    } catch (error) {
      console.error('Error fetching user information:', error);
    }
  };

  return (
    <div>
      <button onClick={fetchUserInfo}>Fetch User Information</button>
      {userInfo && (
        <div>
          <p>Username: {userInfo.username}</p>
          <p>Password: {userInfo.pwd}</p>
        </div>
      )}
    </div>
  );
};

export default Testfetch;
